import styled from "styled-components";

export const Transaction = styled.div`
  .contain {
    background: #444;
    position: absolute;
    height: 40%;
    bottom: 0em;
    z-index: 1;
  }

  .contain .list {
    list-style: none;
    display: block;
  }

  .contain .list li {
    display: block;
    cursor: pointer;
    font-size: 0.9em;
  }
`;
